var express = require('express');
var router = express.Router();
const aad = require('azure-ad-jwt');
const blobService = require('../services/BlobService');
const TOKEN_CHECK = process.env.TOKEN_CHECK

var verifyToken = 'false'

/* GET blob listing. */
/**
 * @swagger
 * /api/blob/all:
 *   get:
 *     security:
 *       - Bearer: []
 *     tags: ["blob"]
 *     summary: Find all blobs
 *     description: Get all blobs
 *     responses: 
 *       200:
 *         description: Success 
 */
router.get('/all', async function (req, res, next) {
    try {
        if (TOKEN_CHECK == 'true') {
            token = req.headers['authorization'];
            req_token = token.split(' ');
            lastToken = req_token[1];
            aad.verify(lastToken, null, function (err, result) {
                if (result) {
                    verifyToken = 'true';
                }
                if (lastToken == "neha" || verifyToken == 'true') {
                    blobService.getAllBlobs(function (err, data) {
                        if (err) {
                            res.status(500).send({
                                message: err.message || "Some error occurred while retrieving product details."
                            })
                        } else {
                            res.send(data);
                        }
                    })
                }
            })
        }
    }
    catch (err) {
        res.status(401).send({
            message: "Unauthorized user"
        })
    }
})

/* Add new blob. */
/**
* @swagger
* /api/blob:
*   post:
*     security:
*       - Bearer: []
*     tags: ["blob"]
*     summary: Add new blob
*     description: Add new blob
*     parameters:  
*       - in: body
*         name: body
*         description: Blob object that need to be added
*         required: true
*         schema:
*           $ref: '#/definitions/Blob'
*     responses: 
*       200:
*         description: success
*/
router.post('/', async function (req, res, next) {
    try {
        if (TOKEN_CHECK == 'true') {
            token = req.headers['authorization'];
            req_token = token.split(' ');
            lastToken = req_token[1];
            aad.verify(lastToken, null, function (err, result) {
                if (result) {
                    verifyToken = 'true';
                }
                if (lastToken == "neha" || verifyToken == 'true') {
                    blobService.addBlob(req, (err, data) => {
                        if (err) {
                            res.status(500).send({
                                message: err.message || "Some error occurred while adding blob."
                            })
                        } else {
                            res.send(data);
                        }
                    })
                }
            })
        }
    }
    catch (err) {
        res.status(401).send({
            message: "Unauthorized user"
        })
    }
})


/**
* @swagger
*definitions:
*  Blob:
*    type: object
*    properties:
*      binary:
*        type: string
*        example: "data:image/jpeg;base64,"
*/

module.exports = router;